import React from "react";
import "./navBar.css";
import logo from "../../assets/logo.png";
import contactImage from "../../assets/contact.png";
import { Link } from "react-scroll";

const NavBar = () => {
  return (
    <nav className="navBar">
      <img src={logo} alt="Logo" className="logo" />
      <div className="navBarMenu">
        <Link
          className="navBarMenuListItem"
          activeClass="active"
          to="introduction"
          spy={true}
          smooth={true}
          offset={-100}
          duration={1000}
        >
          Home
        </Link>
        <Link
          className="navBarMenuListItem"
          activeClass="active"
          to="about"
          spy={true}
          smooth={true}
          offset={-100}
          duration={1000}
        >
          About
        </Link>
        <Link
          className="navBarMenuListItem"
          activeClass="active"
          to="projects"
          spy={true}
          smooth={true}
          offset={-100}
          duration={1000}
        >
          Projects
        </Link>
        <Link
          className="navBarMenuListItem"
          activeClass="active"
          to="skills"
          spy={true}
          smooth={true}
          offset={-100}
          duration={1000}
        >
          Skills
        </Link>
        <Link
          className="navBarMenuListItem"
          activeClass="active"
          to="education"
          spy={true}
          smooth={true}
          offset={-100}
          duration={1000}
        >
          Education
        </Link>
      </div>
      <button
        className="contactMe"
        onClick={() => {
          document
            .getElementById("contact")
            .scrollIntoView({ behavior: "smooth" });
        }}
      >
        <img src={contactImage} alt="Contact" className="btnImage" />
        Contact Me
      </button>
    </nav>
  );
};

export default NavBar;
